import { Rect } from 'react-konva';
import Konva from 'konva';

export default props => {
    const height = 20;

    return <>
        <Rect
            x={window.innerWidth}
            y={window.innerHeight - 100}
            width={window.innerWidth} height={height}
            fill={Konva.Util.getRandomColor()} />

        {/* {props.children} */}
    </>
}
